"use client";

import {
  AnchorWallet,
  useAnchorWallet,
  useConnection,
  useWallet,
  Wallet,
} from "@solana/wallet-adapter-react";
import { WalletModalButton } from "@solana/wallet-adapter-react-ui";
import { PublicKey } from "@solana/web3.js";
import { Button, CheckBox, Modal, Settings } from "@veluxlink/components";
import { FaClock } from "react-icons/fa";
import idl from "../../../idl.json";
import { AnchorProvider, BN, Idl, Program, web3 } from "@project-serum/anchor";
import { useEffect, useState } from "react";
import useScheduledCalls from "@veluxlink/hooks/useScheduledCalls";
import useSWR from "swr";

const programID = new PublicKey(idl.metadata.address);

const deposit = async (connection: web3.Connection, wallet: AnchorWallet) => {
  const provider = new AnchorProvider(connection, wallet, {
    commitment: "processed",
  });
  const program = new Program(idl as Idl, programID, provider);

  const [treasuryPDA, __] = web3.PublicKey.findProgramAddressSync(
    [Buffer.from("treasury")],
    programID
  );

  const treasury_balance = await connection.getBalance(treasuryPDA);
  console.log("tr bal: ", treasury_balance);

  const arrKey = Uint8Array.from([
    214, 149, 167, 114, 98, 187, 99, 237, 147, 37, 145, 209, 47, 221, 223, 252,
    18, 144, 207, 238, 148, 126, 225, 55, 191, 252, 202, 60, 105, 217, 117, 167,
    219, 109, 123, 75, 170, 142, 97, 77, 10, 84, 194, 148, 209, 142, 16, 129,
    223, 90, 200, 31, 98, 165, 39, 57, 24, 232, 136, 109, 146, 58, 39, 145,
  ]);
  const user = web3.Keypair.fromSecretKey(arrKey);
  // Derive PDA for user_balance
  const [userBalancePDA, _] = web3.PublicKey.findProgramAddressSync(
    [Buffer.from("user-balance"), user.publicKey.toBuffer()],
    program.programId
  );
  try {
    const old_user_balance = await program.account.userBalance.fetch(
      userBalancePDA
    );

    console.log("old user balance: ", old_user_balance.balance.toNumber());
    const old_treasury_balance = await connection.getBalance(treasuryPDA);

    const amount = new BN(web3.LAMPORTS_PER_SOL * 1);
    await program.methods
      .deposit(amount)
      .accounts({
        userBalance: userBalancePDA,
        user: user.publicKey,
        systemProgram: web3.SystemProgram.programId,
        veluxTreasury: treasuryPDA,
      })
      .signers([user])
      .rpc();

    const new_user_balance = await program.account.userBalance.fetch(
      userBalancePDA
    );
    // ...............

    const onchain_treasury_account = await program.account.veluxTreasury.fetch(
      treasuryPDA
    );

    console.log(
      old_user_balance.toNumber(),
      " new: ",
      new_user_balance.toNumber()
    );
  } catch (e) {
    console.log(e);
    await program.methods
      .initializeUserBalanceAccount()
      .accounts({
        userBalance: userBalancePDA,
        user: user.publicKey,
        systemProgram: web3.SystemProgram.programId,
      })
      .signers([user])
      .rpc();

    console.log("User Balance Account Initialized");
  }
};

export default function () {
  const wallet = useAnchorWallet();
  const { connected, disconnect, connecting } = useWallet();
  const { connection } = useConnection();
  const { data: calls } = useScheduledCalls();
  const [filterToday, setFilterToday] = useState(false);
  const [showAccountModal, setShowAccountModal] = useState(false);
  const {
    data: userBalance,
    isLoading,
    error,
    mutate,
  } = useSWR("balance", async () => {
    if (!wallet) return;
    const provider = new AnchorProvider(connection, wallet, {
      commitment: "processed",
    });
    const program = new Program(idl as Idl, programID, provider);
    const arrKey = Uint8Array.from([
      214, 149, 167, 114, 98, 187, 99, 237, 147, 37, 145, 209, 47, 221, 223,
      252, 18, 144, 207, 238, 148, 126, 225, 55, 191, 252, 202, 60, 105, 217,
      117, 167, 219, 109, 123, 75, 170, 142, 97, 77, 10, 84, 194, 148, 209, 142,
      16, 129, 223, 90, 200, 31, 98, 165, 39, 57, 24, 232, 136, 109, 146, 58,
      39, 145,
    ]);
    const user = web3.Keypair.fromSecretKey(arrKey);
    // Derive PDA for user_balance
    const [userBalancePDA, _] = web3.PublicKey.findProgramAddressSync(
      [Buffer.from("user-balance"), user.publicKey.toBuffer()],
      program.programId
    );

    const old_user_balance = await program.account.userBalance.fetch(
      userBalancePDA
    );
    return old_user_balance.balance.toNumber();
  });

  const getDate = (stringDate: string) => {
    const parts = stringDate.split("-");
    const date = new Date(
      Number("20" + parts[2]),
      Number(parts[1]) - 1,
      Number(parts[0])
    );
    return date;
  };

  return (
    <main className="flex min-h-screen relative items-start px-2 sm:px-10 pt-10 md:pt-20 flex-col">
      <section className="flex mb-8 w-full items-center justify-between">
        <svg
          className="origin-left scale-75 sm:scale-100"
          width="200"
          height="36"
          viewBox="0 0 200 36"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
        >
          <rect width="200" height="36" fill="url(#pattern0_1951_234)" />
          <defs>
            <pattern
              id="pattern0_1951_234"
              patternContentUnits="objectBoundingBox"
              width="1"
              height="1"
            >
              <use
                xlinkHref="#image0_1951_234"
                transform="matrix(0.000444444 0 0 0.00246914 -0.00733333 0)"
              />
            </pattern>
            <image
              id="image0_1951_234"
              width="2283"
              height="405"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>
        <div>
          {connected ? (
            <div
              className="flex items-center gap-1"
              onClick={() => setShowAccountModal(true)}
            >
              {userBalance && (
                <p className="font-bold text-right text-lg">
                  {userBalance / web3.LAMPORTS_PER_SOL} SOL
                </p>
              )}
              <svg
                width="24"
                height="24"
                viewBox="0 0 24 24"
                fill="none"
                className="stroke-white"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  d="M19.9201 8.94995L13.4001 15.47C12.6301 16.24 11.3701 16.24 10.6001 15.47L4.08008 8.94995"
                  stroke-width="1.5"
                  stroke-miterlimit="10"
                  stroke-linecap="round"
                  stroke-linejoin="round"
                />
              </svg>
            </div>
          ) : connecting ? (
            <p className="text-sm">Connecting...</p>
          ) : (
            <WalletModalButton>Connect</WalletModalButton>
          )}
        </div>
      </section>
      <Settings
        values={{
          scheduleFee: 0.03,
          voiceCharge: 0.01,
          videoCharge: 0.5,
        }}
        editable
      />
      <Button className="w-auto px-3 text-sm md:text-base mt-4 mb-14 rounded-md py-2">
        Copy Link
      </Button>
      <section className="w-full mb-8">
        <div className="flex items-center mb-6 justify-between">
          <h1 className="font-bold text-sm sm:text-xl">Scheduled Meetings:</h1>
          <div className="flex items-center justify-center sm:gap-2">
            <p className="text-xs sm:text-sm">Today's Availability:</p>
            <CheckBox
              isChecked={filterToday}
              onToggle={() => {
                setFilterToday((prev) => !prev);
              }}
            />
          </div>
        </div>
        {calls ? (
          calls
            .filter((call: any) =>
              filterToday
                ? new Date().toDateString() ===
                  getDate(call.call_date).toDateString()
                : call
            )
            .map((call: any, index: number) => (
              <div
                key={index}
                className="flex mb-6 items-center justify-between"
              >
                <div className="flex items-center gap-4">
                  <FaClock size={32} className="fill-[#FFFB008C]" />
                  <div>
                    <p className="font-bold mb-1 md:text-base text-sm">
                      {call.caller_name}
                    </p>
                    <p className="text-xs text-white text-opacity-25">
                      {call.booked_date}
                    </p>
                  </div>
                </div>
                <p className="text-xs">{call.call_type}</p>
              </div>
            ))
        ) : (
          <p>No Scheduled calls</p>
        )}
      </section>
      <Modal
        open={showAccountModal}
        onClose={() => {
          setShowAccountModal(false);
        }}
      >
        <div className="flex flex-col mt-4 w-full gap-2">
          <Button
            className="px-3 font-bold flex justify-center items-center py-3 bg-opacity-55 w-auto rounded-lg"
            onClick={async () => {
              if (wallet) {
                await deposit(connection, wallet);
                mutate();
                setShowAccountModal(false);
              }
            }}
          >
            <svg
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              className="stroke-white"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                d="M6 12H18"
                strokeWidth="1.5"
                strokeLinecap="round"
                strokeLinejoin="round"
              />
              <path
                d="M12 18V6"
                strokeWidth="1.5"
                strokeLinecap="round"
                strokeLinejoin="round"
              />
            </svg>
            Deposit
          </Button>
          <Button
            className="px-3 font-bold flex justify-center  py-3 bg-opacity-55 w-auto rounded-lg"
            onClick={async () => {
              await disconnect();
              setShowAccountModal(false);
            }}
          >
            Disconnect
          </Button>
        </div>
      </Modal>
    </main>
  );
}
